import React from "react";
import "../../css/buttonsStyle/buttonFour.css";

const ButtonFour = () => {
  return (
    <div className="bFourFlexContainer">
      <div className="bFourSprite-sun">
        <div className="iconMiddleCircle"></div>
      </div>
    </div>
  );
};

export default ButtonFour;
